description:




		Dataset Card


This is a dataset containing ML ArXiv papers. The dataset is a version of the original one from CShorten, which is a part of the ArXiv papers dataset from Kaggle. 
Three steps are made to process the source data:

useless columns removal;
train-test split;
'\n' removal and trimming spaces on sides of the text.

The JSON file structure of data from one topic is as follows:
{
  "max_scores" : [list of numbers] ,
  "attempts" : [
    {
      "id " : str,
      "records" : [list of lists of numbers],
    }
  ]
}

where:
• max_scores: The length of the list is the number of questions of the topic, and the value of each
element is the maximum score for a question,
• attempts: List of student attempts.
• id: Student ID
• records: The length of the outer list is the number of questions of the topic, the… See the full description on the dataset page: https://huggingface.co/datasets/ducngg/dsa-result.
